import React from 'react';

export default function Card(props) {
  // ac치 va tu c칩digo
  return (<div>
            <button>X</button>
            <h3>{props.name}</h3>
            <h3>Max</h3>
            <p>{props.max}</p>
            <h3>Min</h3>
            <p>{props.min}</p>
            <img src={`http://openweathermap.org/img/wn/${props.img}@2x.png`} alt="" />
          </div>)
};
